import React from 'react';

// Theme colors for Video A (blue), Video B (red), and neutral states
const themeColors = {
  blue: 'bg-[#2563eb]',  // Blue for Video A
  red: 'bg-[#be123c]',   // Red for Video B
  neutral: 'bg-[#4b5563]', // Neutral color for a draw or unranked
};

const BracketDisplay = ({ tournament }) => {
  // Return early if tournament data is invalid
  if (!tournament?.bracket || !Array.isArray(tournament.bracket)) return null;
  if (!Array.isArray(tournament.videos)) return <div className="text-red-500">No videos data available</div>;
  if (tournament.bracket.length === 0) return <div className="text-gray-500">No rounds available</div>;

  // Get the leader of the match based on votes
  const getVoteLeader = (match) => {
    const votesA = (tournament.votes || []).filter(v => v.matchId === match.id && v.votedFor === match.videoAId).length;
    const votesB = (tournament.votes || []).filter(v => v.matchId === match.id && v.votedFor === match.videoBId).length;
    return votesA > votesB ? 'A' : (votesB > votesA ? 'B' : null); // 'A' or 'B' or null for draw
  };

  return (
    <div className="w-full flex justify-center py-8">
      <div className="flex flex-col gap-6 w-full max-w-screen-xl px-4">
        {tournament.bracket.map((round, ridx) => (
          <div
            key={ridx}
            className="flex flex-col gap-4 bg-gradient-to-b from-[#1e0039] to-[#7b2cbf] rounded-xl px-6 py-4 shadow-lg"
          >
            <div className="text-2xl font-extrabold text-center text-[#f9eeff] mb-4">
              Round {round.round}
            </div>
            {round.matches.map((match) => {
              const vidA = tournament.videos.find(v => v.id === match.videoAId);
              const vidB = tournament.videos.find(v => v.id === match.videoBId);
              const leader = getVoteLeader(match);

              // Get vote counts
              const votesA = (tournament.votes || []).filter(v => v.matchId === match.id && v.votedFor === match.videoAId).length;
              const votesB = (tournament.votes || []).filter(v => v.matchId === match.id && v.votedFor === match.videoBId).length;

              // Calculate vote percentage for progress bars
              const totalVotes = votesA + votesB;
              const percentageA = totalVotes === 0 ? 0 : (votesA / totalVotes) * 100;
              const percentageB = totalVotes === 0 ? 0 : (votesB / totalVotes) * 100;

              return (
                <div
                  key={match.id}
                  className="flex flex-col bg-[#240046] rounded-xl shadow-lg px-6 py-4 transition-all hover:bg-[#7b2cbf]/70 cursor-pointer"
                  onClick={() => alert(`Match ID: ${match.id}\nVoting Details:\nVideo A: ${votesA} votes\nVideo B: ${votesB} votes`)} // Placeholder for voting analysis
                >
                  <div className="flex justify-between items-center">
                    {/* Video A Title */}
                    <div className={`font-bold text-lg text-center w-[150px] truncate ${leader === 'A' ? themeColors.blue : leader === 'B' ? themeColors.red : themeColors.neutral}`}>
                      {vidA?.title || 'A'}
                    </div>

                    {/* VS Divider */}
                    <div className="text-[#f9eeff] text-xl">vs</div>

                    {/* Video B Title */}
                    <div className={`font-bold text-lg text-center w-[150px] truncate ${leader === 'B' ? themeColors.red : leader === 'A' ? themeColors.blue : themeColors.neutral}`}>
                      {vidB?.title || 'B'}
                    </div>
                  </div>

                  <div className="mt-4">
                    {/* Voting Progress Bar */}
                    <div className="flex gap-2 text-sm text-[#f9eeff]">
                      <div className="w-[50%] flex items-center justify-center">
                        <span className="text-[#2563eb]">{votesA}</span>
                      </div>
                      <div className="w-[50%] flex items-center justify-center">
                        <span className="text-[#be123c]">{votesB}</span>
                      </div>
                    </div>
                    <div className="flex gap-2 mt-2">
                      <div className="w-[50%] bg-[#2563eb] h-3 rounded-lg" style={{ width: `${percentageA}%` }} />
                      <div className="w-[50%] bg-[#be123c] h-3 rounded-lg" style={{ width: `${percentageB}%` }} />
                    </div>
                  </div>
                </div>
              );
            })}
          </div>
        ))}
      </div>
    </div>
  );
};

export default BracketDisplay;
